import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

export function SearchBar() {
    const navigate = useNavigate();
    const [searchParams, setSearchParams] = useState({ cityZipCode: '', artistEventVenue: '' });

    const handleSubmit = (event) => {
        event.preventDefault();
        // Pass search parameters via state
        navigate('/Result', { state: { searchParams } });
    };

    const handleChange = (event) => {
        setSearchParams({
            ...searchParams,
            [event.target.name]: event.target.value,
        });
    };

    return (
        <form id="search-bar-form" onSubmit={handleSubmit}>
            <label htmlFor="city-zip-code">City or Zip Code:</label>
            <input type="text" id="city-zip-code" name="cityZipCode" placeholder="City..." onChange={handleChange} value={searchParams.cityZipCode} />

            <label htmlFor="search-artist-event-venue">Search by Artist, Event, or Venue:</label>
            <input id="search-artist-event-venue" name="artistEventVenue" className="search-2" type="text" placeholder="Search by artist, event or venue..." onChange={handleChange} value={searchParams.artistEventVenue} />

            <button type="submit">Search</button>
        </form>
    );
}

export function SearchBarForResult() {
    const navigate = useNavigate();
    const [searchParams, setSearchParams] = useState({ cityZipCode: '', artistEventVenue: '' });

    const handleSubmit = (event) => {
        event.preventDefault();
        // Pass search parameters via state
        navigate('/Result', { state: { searchParams } });
    };

    const handleChange = (event) => {
        setSearchParams({
            ...searchParams,
            [event.target.name]: event.target.value,
        });
    };


    return (
        <div className="searchbar-result">
            <form id="search-bar-form" onSubmit={handleSubmit}>
                <label htmlFor="location">City or zip code</label>
                <input type="text" id="location" name="cityZipCode" className="text-result" placeholder="City..." onChange={handleChange} value={searchParams.cityZipCode} />

                <label htmlFor="search-result">Search by artist...</label>
                <input className="search-result" type="text" id="search-result" name="artistEventVenue" placeholder="Search by artist, event or venue..." onChange={handleChange} value={searchParams.artistEventVenue}/>

                <button type="submit">Search</button>
            </form>
        </div>
    );
}
